import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { ConfirmHumanComponent } from './confirm-human.component';

@NgModule({
  declarations: [
    ConfirmHumanComponent
  ],
  imports: [
    BrowserModule,
  ],
})
export class ConfirmHumanModule { }
